import * as light_style from "../../css/light/phoneListContainer"

export default function ListItem(props) {
  return (
    <div style={light_style.phoneListContainer}>
      <div style={light_style.phoneListContainerMAC}>
        {props.item1}
      </div>
      <div style={light_style.phoneListContainerInfo}>
        <ul style={light_style.phoneListContainerItems}>
          <li style={light_style.phoneListContainerItem}>
            {props.item2}
          </li>
          <li style={light_style.phoneListContainerItem}>
            {props.item3}
          </li>
          <li style={light_style.phoneListContainerItem}>
            {props.item4}
          </li>
          <li style={light_style.phoneListContainerItem}>
            {props.item5}
          </li>
          <li style={light_style.phoneListContainerItem}>
            {props.item6}
          </li>
        </ul>
      </div>
    </div>
  )
}
